        <img src="" alt="" srcset="" />
        <div className="profile-pic">
          <div className="col">
            <img
              src="https://i.pinimg.com/originals/63/a8/45/63a845bfa536ec51341e74691b4d5796.png"
              alt=""
              srcset=""
              className="profile-pic-image"
            />
          </div>
        </div>
      </div>
    </div>
  );
}

export default Profile;
